import React, {Component} from 'react';
import './addcar.css'
class AddCar extends Component {
    render() {
        return (
            <div className={'addcar'}>
                <div >
                    <ul className={'item'}>
                        <li><a href=""><i className={'iconfot icon-shouye1'}/><div>首页</div></a></li>
                        <li><a href=""><i className={'iconfot icon-gouwuche-01'}/><div>购物车</div></a></li>
                    </ul></div>
                <button>加入购物车</button>
            </div>
        );
    }
}

export default AddCar;
